    "2015-08-21T22:40:05.533407",nt"name": "health-data-repository-hdr",nt"isopen":
    true,nt"url": null,nt"notes": "The Health Data Repository (HDR) is a VA
    multi-year development project to create a longitudinal record of Veterans clinical
    data, including a method to display 'legacy' clinical data from 128 Veterans Health
    Information Systems and Technology Architecture (VistA) systems.  Data displayed
    will be in 'real-time' and will come from the Health Data Repository for re-engineered
    applications and VistA for all other clinical applications.  The long-term goal
    of the HDR project is to be a national transactional database that stores all clinical
    data from re-engineered applications and a number of regional databases that will
    provide access to VistA data.",nt"license_title": "Creative Commons CCZero",nt"extras":
